import React from "react";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";

import Hello from './simple/hello';


function App() {
  return (
        <Router>
            <Switch>
              <Route path="/simple/hello" component={Hello} />

            </Switch>
        </Router>
  );
}

export default App;
